(1, '\'Montserrat\', sans-serif', '#3cd827', '#121312', '#121312', '#0A0D0B', '#121312', '#0A0D0B', '#0A0D0B', '#030C16', '#121312', '#121312', '#ffffff', '#ffffff', '#171717', '#171717', '#171717', '#171717', '#171717', '##171717', '#171717', '#171717', '#00bae8', '#1d95b3', '#212425', '#171717', '#121312', '#030C16', '#171717', '#171717', '#121312', '#0A0D0B', '.25rem', '\n/* Estilo para o link com texto verde neon */\n.item-game {\n    color: #0afe68; /* Cor do texto verde neon */\n    text-decoration: none; /* Remove o sublinhado do texto */\n    font-size: 0.875em; /* Define um tamanho de fonte menor (ajuste conforme necessário) */\n    position: relative; /* Necessário para posicionar a sombra do texto */\n}\n\n/* Adiciona a sombra verde neon ao texto */\n.item-game::before {\n    content: \'\'; /* Adiciona um conteúdo vazio antes do link */\n    position: absolute; /* Posiciona a sombra em relação ao link */\n    top: 0;\n    left: 0;\n    width: 100%;\n    height: 100%;\n    background: rgba(10, 254, 104, 0.3); /* Cor verde neon com transparência */\n    z-index: -1; /* Coloca a sombra atrás do texto */\n    filter: blur(8px); /* Adiciona um efeito de desfoque para criar o brilho */\n    border-radius: 4px; /* Mantém os cantos arredondados (ajustar conforme necessário) */\n}\n\n', NULL, NULL, '\n\n', '2024-01-01 17:36:03', '2025-08-01 02:32:25', 'https://kassino.bet/', 'https://kassino.bet/', 'https://kassino.bet/', 'https://kassino.bet/', 'https://kassino.bet/', 'https://kassino.bet/', 'https://kassino.bet/', 'https://kassino.bet/', 'https://kassino.bet/', 'https://kassino.bet/', 'https://kassino.bet/', 'https://kassino.bet/');
